import * as S from "../styles/Home.style";

function Home () {
  return (
    <S.Container>
      <S.Box>
        <S.Button>버튼이야</S.Button>
        <S.Input placeholder="Input입니당"></S.Input>
        <S.Select>
          <optgroup label="옵션이다!"></optgroup>
          <option>옵션1</option>
          <option>옵션2</option>
          <option>옵션3</option>
          <option>옵션4</option>
        </S.Select>
      </S.Box>
    </S.Container>
  )
}

export default Home;
